String.prototype.startsWith=function(e){"use strict";var t=this.substring(0,e.length),n=false;if(t===e&&e!==""&&e!=="undefined"){n=true}return n};String.prototype.contains=function(e){"use strict";var t=false;if(this.indexOf(e)>=0){t=true}return t};String.prototype.emptyString=function(){"use strict";var e=false;if(this.length===0){e=true}return e};String.prototype.reverse=function(){"use strict";var e="",t=0;for(t;t<this.length;t=t+1){e+=this[this.length-1-t]}return e}